svg.script:
    var svgns = "http://www.w3.org/2000/svg";
    var xlinkns = "http://www.w3.org/1999/xlink";
    var lastPos = "344 410"
    var lastId = null;

    var thumbsHolder = document.getElementById("flyingImages");
    var showPosition = document.getElementById("showPosition");
    var mm = document.getElementById("maskMoose");
    var ethalon = document.getElementById("thumbDemo").firstChild;
    var webkit = (window.navigator && window.navigator.userAgent && window.navigator.userAgent.indexOf("WebKit") != -1);
    if (!webkit) document.getElementById("imgDetail").setAttribute("mask", "url(#norwayFlagMask)"); // Webkit corrupted masking temporary fake

    var thumbNames = new Array( 
                                  {i:"IMG_0242.JPG",n:"Beautiful sunset over fjord",t:"462 246"},
                                  {i:"IMG_0563.JPG",n:"National park Rago",t:"450 267"},
                                  {i:"IMG_0924.JPG",n:"Wild moose",t:"429 288"},
                                  {i:"IMG_1001.JPG",n:"Trondheim's buildings",t:"362 357"},
                                  {i:"IMG_1489.JPG",n:"Trollstiegen road",t:"330 376"},
                                  {i:"IMG_1652.JPG",n:"Yet another waterfall",t:"327 379"},
                                  {i:"IMG_0870.JPG",n:"Setegrotta Cave",t:"416 295"},
                                  {i:"IMG_2345.JPG",n:"Ring of clouds", t:"310 391"},
                                  {i:"IMG_2529.JPG",n:"Jostedalsbreen glacier",t:"308 393"},
                                  {i:"IMG_2936.JPG",n:"Galdhopiggen mountain",t:"336 392"},
                                  {i:"IMG_3061.JPG",n:"Stavkirke at Lom",t:"336 386"},
                                  {i:"IMG_3180.JPG",n:"24.5km long tunnel",t:"313 411"},
                                  {i:"IMG_8028.JPG",n:"Waterfall near Tromso",t:"492 218"},
                                  {i:"IMG_3330.JPG",n:"Old Bergen lanes",t:"268 422"},
                                  {i:"IMG_3768.JPG",n:"Incredible Preikestolen",t:"293 455"},
                                  {i:"IMG_1010.JPG",n:"Trondheim's cathedral",t:"361 359"},
                                  {i:"IMG_3976.JPG",n:"Heddal's faery-like church",t:"351 432"},
                                  {i:"IMG_9224.JPG",n:"Lofoten's bay",t:"407 252"},
                                  {i:"IMG_9666.JPG",n:"Fjord view",t:"404 292"},
                                  {i:"IMG_9785.JPG",n:"Lofoten's bridge",t:"433 243"}
                              );

    function showDetail(evt) {
      lastId = evt.target.parentNode.getAttribute("thumb");
      var showPosition = document.getElementById("showPositionFake");
      var newPos = showPosition.cloneNode(true);
      mm.setAttribute("transform", "translate(" + thumbNames[lastId].t + ")");
      evt.target.parentNode.setAttribute("class", "thmbx");
      document.getElementById("imgDetail").setAttributeNS(xlinkns, "href", thumbNames[lastId].i);
      document.getElementById("imgDesc").firstChild.data = thumbNames[lastId].n;
      newPos.setAttribute("from", lastPos);
      newPos.setAttribute("to", thumbNames[lastId].t);
      newPos.setAttribute("begin", document.documentElement.getCurrentTime());
      showPosition.parentNode.appendChild(newPos);
      if (navigator.userAgent.indexOf("Gecko/") == -1) newPos.beginElement();
      showPosition.parentNode.removeChild(showPosition);
      document.getElementById("showPosition").beginElement();
      lastPos = thumbNames[lastId].t;
    }

    function prevPhoto() {
      lastId--;
      if (lastId == -1) lastId = thumbNames.length;
      switchDetail();
    }

    function nextPhoto() {
      lastId++;
      if (lastId == thumbNames.length) lastId = 0;
      switchDetail();
    }

    function switchDetail() {
      mm.setAttribute("transform", "translate(" + thumbNames[lastId].t + ")");

      thumbsHolder.childNodes[lastId].setAttribute("class", "thmbx");
      document.getElementById("showDescQuick").beginElement();
      window.setTimeout(function(){document.getElementById("imgDesc").firstChild.data = thumbNames[lastId].n}, 500);
      document.getElementById("imgDetailQuick").beginElement();
      window.setTimeout(function(){document.getElementById("imgDetail").setAttributeNS(xlinkns, "href", thumbNames[lastId].i)}, 500);

      var showPosition = document.getElementById("showPositionQuick");
      var newPos = showPosition.cloneNode(true);
      newPos.setAttribute("from", lastPos);
      newPos.setAttribute("to", thumbNames[lastId].t);
      newPos.setAttribute("begin", document.documentElement.getCurrentTime());
      showPosition.parentNode.appendChild(newPos);
      if (navigator.userAgent.indexOf("Gecko/") == -1) newPos.beginElement();
      showPosition.parentNode.removeChild(showPosition);

      lastPos = thumbNames[lastId].t;
    }
